import React from 'react'
import {Link} from 'react-router-dom'

const Color = ({color}) => {
  const {colorName, colorCode} = color
  return (
    <div style={{backgroundColor: colorCode}}>
      <h2>{colorName}</h2>
      <Link to="/">Home</Link>
    </div>
  )
}
export default Color
